import React, { Component } from 'react'

export default class FunctionalComponent extends Component {
    render() {
        return (
            <div class="butn_div">
                <div class="last_div">
                    <button class="btn_1">Join Us</button>
                    <button class="btn_2">Setting</button>
                    <button class="btn_3">Login</button>
                    <button class="btn_4">Contact Us</button>
                    <button class="btn_5">Search</button>
                    <button class="btn_6">Help</button>
                    <button class="btn_7">Home</button>
                    <button class="btn_8">Download</button>
                </div>
            </div>
        )
    }
}
